import PropTypes from "prop-types";
import {getSpecificEmployeeByKey} from './MockData'


export function GeneralDisplayPage(props) {
    const [Data, setData] = useState([{Key: "0", Data: [{name: '', value: ''}]}]);
    
    useEffect(() => {
      const GetSpecificEmployee = () => {
          setData([{Key: "0", Data: [{name: '', value: ''}]}]);
        //setData(getSpecificEmployeeByKey(props.GenKey));
      };

      switch (props.GenKey) {
        case 'Locale':
        case 'Branch':
        case 'Employee':
          GetSpecificEmployee();
          break;
          default:
           break;
      }
    }, [props.GenKey]);
    return (
      <ul
      >
        {Data[0].Key}
        {/* {Data[0].Data.map(Values => (
          <li
            key={Values.name}
          >
            <p>{Values.name}</p>
            <input value={Values.value} />
          </li>
        ))} */}
      </ul>
    );

    
  
}


GeneralDisplayPage.propTypes = {
    GenKey: PropTypes.string.isRequired,
  };

  export default GeneralDisplayPage;
